import React, {useState} from 'react'

import {AiOutlineTable, AiOutlineUser} from "react-icons/ai";
import {BiBookmark} from "react-icons/bi";
import RequestUserPostCard from "./RequestUserPostCard";

const ReqUserPost = () => {
    const [activeTab, setActiveTab] = useState()
    const tabs = [
        {
            tab: "Post",
            icon: <AiOutlineTable></AiOutlineTable>,
            activeTab: ""
        },

        {
            tab: "Saved", icon: <BiBookmark></BiBookmark>
        },
        {
            tab: "Tagged",
            icon: <AiOutlineUser></AiOutlineUser>
        }
    ]
    return (
        <div>
            <div className="flex space-x-14 border-t relative">
                {tabs.map((item) => (<div onClick={() => setActiveTab(item.tab)}
                                         className={`${activeTab === item.tab ? "border-t border-black" : "opacity-60"}flex items-center cursor-pointer py-2 text-sm`}>
                    <p>{item.icon}</p>
                    <p className="ml-1">{item.tab}</p>

                </div>))}
            </div>
            <div>
                <div className="flex flex-wrap">
                    {[1,1,1,1,1].map((item)=><RequestUserPostCard/>)}
                </div>
            </div>
        </div>
    )
}

export default ReqUserPost
